values:
Ah, finally I can say it&#39;s winter here in Finland. We have enough snow now and the air feels crisp. It&#39;s cold enough to create this fog-like air that you can see just enough but not too far, if you know what I mean. The temperature is -8 degrees of Celcius which is 17.6 degrees in Fahrenheit so it&#39;s not really cold but feels cold after weeks of slosh.

Winter love. Now waiting summer...
&nbsp;

My sister and my brother-in-law have done it again. I'm drunk again(NOT my fault) [says my b-i-l]!!! They're fooling around while I'm trying to ignore them (because I don't want to be seen as a perv). I'm having a blast, btw. And I need to go the bathroom. I've only been drinkin... well in Finnish it's jekkupatteri, which is Jegermeister and energy drink. Three of those and I'm drunk. I can still stand... I think... so it's not that bad. But my head feels funny. 

Even though they get me drunk (especially my b-i-l) I still love them so it's good. And I know that my sister will take care of me in the morning if she needs to so ;). 

Later!!!&nbsp;
